import "./index.css";

// Desestructuracion
// Asignacion desestructurante

const persona = {
  nombre: "Rimuru",
  apellido: "Tempest",
  edad: 2,
  clave: "Ciel",
};

const { nombre, apellido, edad, clave } = persona;

console.log(nombre, apellido, edad, clave);

const retornarPersona = ({
  nombre,
  edad,
  apellido,
  clave,
  titulo = "Demon Lord",
}) => {
  console.log(nombre, edad, apellido, clave, rango);
};

retornarPersona(persona);
